import { SideBarStyled } from './SideBar.styled';
import { SideBarButtonStyled } from '../Basic/Buttons/SideBarButton.styled';

const SideBar = () => {
	return (
		<SideBar>
			<SideBarButtonStyled>Tracks</SideBarButtonStyled>
			<SideBarButtonStyled>Releases</SideBarButtonStyled>
			<SideBarButtonStyled>Artists</SideBarButtonStyled>
		</SideBar>
	);
};

export default SideBar;
